function printSprite(idx, xpos, ypos, flip) {
  const x = sprites[idx].x
  const y = sprites[idx].y
  const w = sprites[idx].w
  const h = sprites[idx].h
  const eyex = sprites[idx].eyex
  const sx = Math.floor(x/8)
  const sw = Math.ceil((x + w)/8) - sx
  const sy = Math.floor(y/8)
  const offsX = flip ? (sx + sw)*8 - x -w : x - sx*8
  const offsY = y - sy*8
  const sh = Math.ceil((y + h)/8) - sy

  // where to put sprite to have eye at xpos
  const compensatedX = flip ? xpos - w + eyex : xpos - eyex

  clip(compensatedX, ypos, w, h);
  const sprIdx = sy*16 + sx
  spr(sprIdx + FOREGROUND_SPRITE_BASE,
      compensatedX - offsX, ypos - offsY,
      0, 1, flip, 0, sw, sh)
  clip()
  //rectb(xpos-1, ypos-1, w+2, h+2, 15)
}

var spriteIdx = 0
var spriteSpeed = 0.2
var flip = 0

function nextSprite() {
  spriteIdx += spriteSpeed
  if (spriteIdx >= 15) {
    spriteIdx = 7
  }
}

function nextSpriteStopping() {
  if (spriteIdx >= 1 && spriteIdx < 15) {
    spriteIdx = 15
  }

  if (spriteIdx == 0) {
    return
  }

  spriteIdx += spriteSpeed
  if (spriteIdx >= 20) {
    spriteIdx = 0
  }
}

const FIRE_IDX = {
  193: 194,
  194: 193,
  209: 210,
  210: 209,
}
const FIRE_FRAMES_SKIP = 8

function animateFlame() {
  if (frameNo%FIRE_FRAMES_SKIP) {
    return
  }

  for (var x = 0; x < MAP_WIDTH; x++) {
    for (var y = 0; y < MAP_HEIGHT; y++) {
      const idx = mget(x + mapX, y + mapY)
      if (idx in FIRE_IDX) {
        mset(x, y, FIRE_IDX[idx])
      }
    }
  }
}

var frameNo = 0
function TIC()
{
  const spriteIdxInt = Math.floor(spriteIdx)

  const bank = sprites[spriteIdxInt].bank
  sync(2, bank) // sprites
  cls(0)
  animateFlame()
  map()
  print(spriteIdxInt)


  printSprite(spriteIdxInt, Math.floor(x), y, flip)
  //print(spriteIdx.toString())
  const speed = sprites[spriteIdxInt].speed
  if(btn(2)) {
    flip = 1
    x -= speed
    nextSprite()
  } else if(btn(3)) {
    flip = 0
    x += speed
    nextSprite()
  } else {
    x += (flip ? -1 : 1)*speed
    nextSpriteStopping()
  }
  frameNo++
}

